import Skills from "./Skills";

function ExperienceCard({type}) {

    const frontendSkills = [
        { skill: "HTML", expereince: "Experienced" },
        { skill: "CSS", expereince: "Experienced" },
        { skill: "SASS", expereince: "Intermediate" },
        { skill: "JavaScript", expereince: "Basic" },
        { skill: "TypeScript", expereince: "Basic" },
        { skill: "Material UI", expereince: "Intermediate" },
    ]

    const backendSkills = [
      { skill: "PostgreSQL", expereince: "Basic" },
      { skill: "Node JS", expereince: "Intermediate" },
      { skill: "Express JS", expereince: "Intermediate" },
      { skill: "Git", expereince: "Intermediate" },
    ];

    if (type === "frontend") {
        return (
          <div className="md:w-1/2 p-6 rounded-3xl border border-gray-600 border-solid text-center">
            <h2 className="font-[600] text-[1.75rem] mb-[2rem]">
              Frontend Development
            </h2>
            <div className="flex text-left flex-wrap flex-row gap-[2.5rem] justify-around">
              <Skills skill="HTML" experience="Experienced" />
              <Skills skill="CSS" experience="Experienced" />
              <Skills skill="SASS" experience="Intermediate" />
              <Skills skill="JavaScript" experience="Basic" />
              <Skills skill="TypeScript" experience="Basic" />
              <Skills skill="Material UI" experience="Intermediate" />
            </div>
          </div>
        );
    }

    else if (type ==="backend") {
        return (
            <></>
        );
    }
}

export default ExperienceCard;
